import {Box} from "@mui/material";
import Header from "../../components/Header";

const Inventory =()=>{
    return <Box m="20px">
        <Box display="flex" justifyContent="space-between" align>
        <Header title = " Inventory " subtitle ="Inventory Details" />
        </Box>
        </Box>
};
export default Inventory;
